scriptlet.script:
result = scriptletRawResult['returnResult'];
protocol = scriptletContext.get("protocol");
error = scriptletRawResult['exception'];

if ((protocol.indexOf("Telnet") != -1) && ( error == null))
{
    if ((result.indexOf("correct") != -1) && (result.indexOf("not correct") == -1))
    {
        scriptletResponse = "failure";
        scriptletContext.put("returnCode", "-1");
        scriptletResult = "Login Validation Failed";   
    }
}
